schema:
{
 "description": "MultiMapSpec defines the desired state of MultiMap",
 "properties": {
  "asyncBackupCount": {
   "default": 0,
   "description": "Number of asynchronous backups.",
   "format": "int32",
   "type": "integer"
  },
  "backupCount": {
   "default": 1,
   "description": "Number of synchronous backups.",
   "format": "int32",
   "type": "integer"
  },
  "binary": {
   "default": false,
   "description": "Specifies in which format data will be stored in your multiMap. false: OBJECT true: BINARY",
   "type": "boolean"
  },
  "collectionType": {
   "default": "SET",
   "description": "Type of the value collection",
   "enum": [
    "SET",
    "LIST"
   ],
   "type": "string"
  },
  "hazelcastResourceName": {
   "description": "HazelcastResourceName defines the name of the Hazelcast resource.",
   "minLength": 1,
   "type": "string"
  },
  "name": {
   "description": "Name of the data structure config to be created. If empty, CR name will be used. It cannot be updated after the config is created successfully.",
   "type": "string"
  }
 },
 "required": [
  "hazelcastResourceName"
 ],
 "title": "Multi Map",
 "type": "object"
}
